import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    background: {
        position: 'relative',
        overflow: 'hidden',
        width: '100%',
        height: '100%',
        backgroundColor: '#5656ef'
    },
    backgroundSplit: {
        position: 'absolute',
        width: 0,
        height: 0,
        borderTop: '1500px solid #FFF',
        borderRight: '1500px solid transparent'
    },
    webBlock: {
        marginTop: 40,
        width: '100%',
        height: '100%'
    },
    switchWrapper: {
        position: 'relative',
        '& > div': {
            position: 'absolute'
        }
    }
}))

export default useStyles
